const state={}

const mutations={}

const actions={
  //获取购物车列表数据
  async getCartList({commit}){
    let result = await reqCarList();
    console.log(result);
    if (result.status==200){
      commit('GETCARTLIST',result)
    }
  }
}

const getters={}

export default {
  state,
  mutations,
  actions,
  getters
}
